__NUXT_JSONP__("/svet/mesto/marabella", (function(a,b,c,d){return {data:[{place:[{id:2237,id_state:b,name:"Marabella",population:26700,area:5.43,altitude:10,id_continent:a,id_administrative_unit:a,id_districts:a,slug:"marabella",information_chatgpt:a,image_cover:a,image_hero:a,coordinates:a}],placeState:[{id:b,mpz:"TT",tld:".tt",name:"Trinidad a Tobago",area:5128,population:1399466,slug:"trinidad-a-tobago",id_continent:1,number_cities:a,information_chatgpt:"\u003Cp\u003ETrinidad a Tobago je malý ostrovní stát v Karibiku, který se skládá ze dvou hlavních ostrovů a několika menších ostrůvků. Země je známá svými bílými plážemi, turistickými atrakcemi, tropickou flórou a faunou, karnevaly a bohatou kulturou.\u003C\u002Fp\u003E\n\u003Cp\u003EHlavním městem je Port of Spain, které je centrem obchodu, kultury a zábavy v zemi. Mezi hlavní turistické atrakce patří například Narodní park Queen's Park Savannah, který je ideálním místem pro pikniky, procházky a sportovní aktivity. Dále pak je zde Botanická zahrada, kde můžete obdivovat tropické rostliny a květiny. Oblíbeným místem pro turisty je také Maracas Bay, známá pro své vysoké vlny a surferské pláže.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě toho má Trinidad a Tobago také bohatou historii a kulturu, kterou můžete objevovat v národních muzeích a galeriích. Mezi nejvýznamnější kulturní akce patří karneval, který se koná v únoru a představuje největší festival v zemi. Na karnevalu se můžete těšit na různé druhy tance, hudby, módy a zábavy.\u003C\u002Fp\u003E\n\u003Cp\u003ETrinidad a Tobago je také rájem pro milovníky přírody, díky své rozmanité a exotické fauně a flóře. Například můžete navštívit Narodní park Yerette, kde se nachází jedna z největších populací kolibříků na světě. Dále pak je tu Tobago Main Ridge Forest Reserve, nejstarší chráněné území v zemi, které nabízí návštěvníkům možnost vidět vzácná zvířata a rostliny.\u003C\u002Fp\u003E\n\u003Cp\u003EKromě turistických atrakcí a přírodních krás nabízí Trinidad a Tobago také bohatou a pestrou kuchyni. Místní kuchyně se skládá z mnoha kořeněných jídel, zeleniny a ryb. Mezi nejpopulárnější jídla patří například curried chicken, roti, ackee and saltfish a callaloo. Místní koktejly jsou také velmi oblíbené, jako například rum punch a piña colada.\u003C\u002Fp\u003E",image_cover:a,image_hero:a,currency_code:"TTD",currency_name:"Trinidadsko-tobagský dolar",money_prices:a,phone_numbers_emergency:a,phone_prefix:"+1-868",coordinates:[[{latitude:c,longitude:d}],{latitude:c,longitude:d}],people_religion:a,people_nationality:a,people_education:a,visitors_entry:a}],placeContinent:a}],fetch:{},mutations:void 0}}(null,226,"10.6918","-61.2225")));